const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");

// const base64Image = "data:image/png;base64,PUT-YOUR-BASE64-HERE";
const base64Image =
  "data:image/png;base64,";
let resolution = 2;
let dots = [];
let mouse = { x: null, y: null };
const repelRadius = 60;
const repelStrength = 8;

// Mouse tracking
canvas.addEventListener("mousemove", (e) => {
  const rect = canvas.getBoundingClientRect();
  mouse.x = e.clientX - rect.left;
  mouse.y = e.clientY - rect.top;
});

canvas.addEventListener("mouseleave", () => {
  mouse.x = null;
  mouse.y = null;
});

const img = new Image();
img.src = base64Image;

img.onload = () => {
  canvas.width = img.width;
  canvas.height = img.height;

  ctx.drawImage(img, 0, 0);
  const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
  prepareDots(imageData);
  animate(); // Start animation loop
};

function prepareDots(imageData) {
  const data = imageData.data;
  const width = imageData.width;
  const height = imageData.height;

  dots = [];

  for (let y = 0; y < height; y += resolution) {
    for (let x = 0; x < width; x += resolution) {
      const i = (y * width + x) * 4;
      const r = data[i];
      const g = data[i + 1];
      const b = data[i + 2];
      const brightness = (r + g + b) / 3;
      const alpha = brightness / 255;

      if (Math.random() < alpha) {
        dots.push({
          originalX: x,
          originalY: y,
          x: x,
          y: y,
          size: Math.max(0.5, (alpha * resolution) / 3.5),
        });
      }
    }
  }
}

function animate() {
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  ctx.fillStyle = "black";
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  for (let dot of dots) {
    // Return to original position smoothly
    let dx = dot.x - dot.originalX;
    let dy = dot.y - dot.originalY;
    dot.x -= dx * 0.1;
    dot.y -= dy * 0.1;

    // Apply repel force if mouse is near
    if (mouse.x !== null && mouse.y !== null) {
      const distX = dot.x - mouse.x;
      const distY = dot.y - mouse.y;
      const dist = Math.sqrt(distX * distX + distY * distY);

      if (dist < repelRadius) {
        const force = (repelRadius - dist) / repelRadius;
        const angle = Math.atan2(distY, distX);

        dot.x += Math.cos(angle) * force * repelStrength;
        dot.y += Math.sin(angle) * force * repelStrength;
      }
    }

    ctx.beginPath();
    ctx.arc(dot.x, dot.y, dot.size, 0, Math.PI * 2);
    ctx.fillStyle = "white";
    ctx.fill();
  }

  requestAnimationFrame(animate);
}
